import React from 'react';


function CardItem(props){
    return (
        <div class="cart item"> 
            <img class="image-item" src={props.image} alt="product" />
            <div class="info-item">
            <h4 class="name-item">{props.name}</h4>
            <h5 class="price-item">{props.price}</h5>
            <span class="remove-item" id="${item.id}-remove">
                <i class="far fa-trash-alt"></i>
            </span>
            </div>
            <div>
                <i class="fas fa-chevron-up cart-up" id="${item.id}-up"></i>
            <p class="item-amount">1</p>
                <i class="fas fa-chevron-down cart-down" id="${item.id}-down"></i>
            </div>
        </div>
    );
}

export default CardItem;
